import React from "react";
import { responsive } from "./responsive.js";
export default class Dsa extends React.Component{
    constructor(props){
        super(props)
        this.state={style:responsive.dsa()}
    }
    render(){
        return(
            <div style={this.state.style}>
                Data structures
            </div>
        )
    }
}
